import Vue from "vue";
import Vuex from "vuex";
import login from "./modules/login";
import language from "./modules/language";
import getters from "./getters";

Vue.use(Vuex);

const store = new Vuex.Store({
  state: {
    errType: "错误",
    mask: false,
    loading: false,
    txt:
      '<p><img src="data:image/png;base64,"></p><p>${asdasd}</p><p><br></p><p>${sssss}</p><p><br></p><p>${vvvv}</p>'
  },
  mutations: {
    setMask(state, mask) {
      state.mask = mask;
    },
    setErrMsg(state, errMsg) {
      Vue.prototype.$alert(errMsg, state.errType);
    },
    setLoading(state, loading) {
      state.loading = loading;
    },
    clean(state) {
      state.loading = false;
      state.mask = false;
    }
  },
  actions: {},
  modules: {
    login,
    language
  },
  getters
});

export default store;
